import React, { useState } from "react";
import {
  AppBar,
  Toolbar,
  IconButton,
  Box,
  Avatar,
  Menu,
  MenuItem,
  useMediaQuery,
  Tooltip,
} from "@mui/material";
import { useTheme } from "@mui/material/styles";
import ShareIcon from "@mui/icons-material/IosShare";
import Brightness4Icon from "@mui/icons-material/Brightness4";
import Brightness7Icon from "@mui/icons-material/Brightness7";
import NotificationsNoneIcon from "@mui/icons-material/NotificationsNone";
import ArrowDropDownIcon from "@mui/icons-material/ArrowDropDown";
import logo from "../assets/logo.png";

const Header = () => {
  const theme = useTheme();
  const isMobile = useMediaQuery(theme.breakpoints.down("sm"));
  const [darkMode, setDarkMode] = useState(false);
  const [anchorEl, setAnchorEl] = useState(null);

  const handleShare = () => {
    if (navigator.share) {
      navigator.share({
        title: "Nairobi Chapel â€“ Ngong Road",
        url: window.location.href,
      });
    } else {
      navigator.clipboard.writeText(window.location.href);
      alert("Link copied to clipboard!");
    }
  };

  const handleToggleTheme = () => {
    setDarkMode((prev) => !prev);
    // Optional: persist theme choice or apply theme context
  };

  const handleMenuOpen = (event) => setAnchorEl(event.currentTarget);
  const handleMenuClose = () => setAnchorEl(null);

  return (
    <AppBar
      position="fixed"
      elevation={0}
      sx={{
        zIndex: (theme) => theme.zIndex.drawer + 1,
        background: "#555555",
        backdropFilter: "blur(8px)",
        borderBottom: "1px solid #e0e0e0",
      }}
    >
      <Toolbar sx={{ justifyContent: "space-between" }}>
        {/* Left: Logo */}
        <Box display="flex" alignItems="center">
          <img src={logo} alt="Nairobi Chapel Logo" style={{ height: 40, marginRight: 12 }} />
        </Box>

        {/* Right: Actions */}
        <Box display="flex" alignItems="center">
          {isMobile ? (
            <>
              <Tooltip title="Options">
                <IconButton color="inherit" onClick={handleMenuOpen}>
                  <ArrowDropDownIcon />
                </IconButton>
              </Tooltip>
              <Menu anchorEl={anchorEl} open={Boolean(anchorEl)} onClose={handleMenuClose}>
                <MenuItem onClick={() => { handleShare(); handleMenuClose(); }}>
                  <ShareIcon fontSize="small" sx={{ mr: 1 }} /> Share
                </MenuItem>
                <MenuItem onClick={() => { handleToggleTheme(); handleMenuClose(); }}>
                  {darkMode ? <Brightness7Icon fontSize="small" sx={{ mr: 1 }} /> : <Brightness4Icon fontSize="small" sx={{ mr: 1 }} />} Theme
                </MenuItem>
                <MenuItem onClick={handleMenuClose}>
                  <NotificationsNoneIcon fontSize="small" sx={{ mr: 1 }} /> Notifications
                </MenuItem>
              </Menu>
            </>
          ) : (
            <>
              <Tooltip title="Share">
                <IconButton color="inherit" onClick={handleShare} sx={{ mr: 1 }}>
                  <ShareIcon />
                </IconButton>
              </Tooltip>
              <Tooltip title="Notifications">
                <IconButton color="inherit" sx={{ mr: 1 }}>
                  <NotificationsNoneIcon />
                </IconButton>
              </Tooltip>
              <Tooltip title="Toggle Theme">
                <IconButton color="inherit" onClick={handleToggleTheme} sx={{ mr: 1 }}>
                  {darkMode ? <Brightness7Icon /> : <Brightness4Icon />}
                </IconButton>
              </Tooltip>
            </>
          )}

          {/* Avatar (Always visible) */}
          <Avatar
            alt="Admin"
            src=""
            sx={{ bgcolor: "#888", width: 32, height: 32, ml: 1 }}
          />
        </Box>
      </Toolbar>
    </AppBar>
  );
};

export default Header;
